import React, { Component } from 'react';
import axios from 'axios'
import { Link } from 'react-router-dom';

class Tables extends Component {
    constructor(props) {
        super(props);
        this.state = {
            listuser: []
        }
    }

    componentDidMount() {
        axios.get('http://localhost/react/users/getUsers.php').then(res => {
            console.log(res);
            this.setState({ listuser: res.data });
        });
    }

    render() {
        return (
            <div id="page-wrapper" style={{ minHeight: '254px' }}>
                <div className="container-fluid">
                    <div className="row bg-title">
                        <div className="col-lg-12">
                            <h4 className="page-title">Basic Table</h4>
                            <ol className="breadcrumb">
                                <li><a href="#">Dashboard</a></li>
                                <li className="active">Basic Table</li>
                            </ol>
                        </div>
                        {/* /.col-lg-12 */}
                    </div>
                    {/* row */}
                    <div className="row">
                        <div className="col-sm-12">
                            <div className="white-box">
                                <h3>Users</h3>
                                <Link to='/Forms'><button type="button" className="btn btn-primary">Add new User</button></Link>
                                <div className="table-responsive">
                                    <table className="table">
                                        <thead>
                                            <tr>
                                                <th>First Name</th>
                                                <th>Last Name</th>
                                                <th>Gender</th>
                                                <th>Email</th>
                                            </tr>
                                        </thead>
                                        {this.state.listuser.map((el,index) =>
                                            <tbody>
                                                <tr>
                                                    <td>{el.first_name}</td>
                                                    <td>{el.last_name}</td>
                                                    <td>{el.gender}</td>
                                                    <td>{el.email}</td>
                                                </tr>
                                            </tbody>
                                        )}
                                    </table>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                {/* /.container-fluid */}
            </div>
        );
    }
}

export default Tables;
